import * as React from 'react'
import { Navbar, Nav } from 'react-bootstrap'

class MyHeader extends React.Component {

    render() {
        return (
            <Navbar fixedTop={true} bg={'ligth'} expanded={'lg'}>
                <Navbar.Brand href={'/home'}>Production System</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.link href={'/operacional'}>Operacional</Nav.link>
                        <Nav.link href={'/tatico'}>Tático</Nav.link>
                        <Nav.link href={'/estrategico'}>Estratégico</Nav.link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default MyHeader
